(6, 'how can I find my courses ?', 'test'),
(7, 'how can I post a course ?', ' you should be a teacher to post courses. please sign up as a teacher !'),
(8, 'how can I play ?', 'please login first , then choose the course you want to enroll in and press enroll button'),
(9, 'How does e-learning benefit your organization ?', 'e-Learning is reusable, cost effective training process, where content is prepared and paid for once but used again and again. It can be deployed rapidly and it is totally flexible to meet the needs of an organization. Once created, the material can be delivered anywhere and anytime with virtually no additional cost. Since e-learning is primarily self-directed, there is no need for individuals to resolve the typical conflicts between their ongoing work projects and required training; the courses are available to meet each individual’s schedule. And since the training is computer based, it can be scaled very effectively…delivering the same training to large numbers of employees at multiple locations at virtually the same time…or at any time at all.'),
(10, 'How do you ensure the quality of online courses ?', 'How do you ensure the quality of face-to-face courses? If I had to point to any single trend that has raised the quality of teaching and learning in higher education over the past two decades, my nomination would be online education.'),
(11, ' what are the challenges of distance learning amid the coronavirus pandemic ? ', 'The big design challenges of distancing learning during COVID-19 had to do with speed and with scale. We know how to create quality online learning experiences. Quality online learning, however, is resource- and time-intensive. Traditional online programs are designed over a period of many months. In March of 2020, colleges and universities had mere days (and sometimes hours) to pivot from residential to remote learning. And not only was this pivot almost instant, it had to be accomplished for every student and every class.\r\n\r\nSchools that could make the pivot to remote learning more effectively were those with a history of running online, low-residency and blended programs. Schools that struggled are those with no online learning programs or that outsourced the core competencies of instructional design to outside companies (OPMs).\r\n\r\nA key to institutional resiliency will be a commitment to invest in blended, low-residency and online learning. Finding the dollars to invest in instructional designers is no longer a \"nice to have\" or a \"luxury\" of well-resourced schools. Instructional design should be considered a cornerstone competency of every college and university.');

